package com.bibinet.intelibuild.mvp.presenter;import android.app.Activity;import com.bibinet.intelibuild.mvp.model.ProductInfoEnsureActivityModel;import com.bibinet.intelibuild.mvp.view.ProductInfoEnsureActivityView;import java.io        .IOException;import okhttp3.Call;import okhttp3.Callback;import okhttp3.Response;/** * Created by bibinet on 2018-1-12. */public class ProductInfoEnsureActivityPresenter extends BasePresenter{    private ProductInfoEnsureActivityView productInfoEnsureActivityView;    private ProductInfoEnsureActivityModel productInfoEnsureActivityModel;    public ProductInfoEnsureActivityPresenter(ProductInfoEnsureActivityView productInfoEnsureActivityView) {        this.productInfoEnsureActivityView = productInfoEnsureActivityView;        productInfoEnsureActivityModel=new ProductInfoEnsureActivityModel();    }    public void postProductEnsureInfo(Activity activity,String userId,String productFileNumber, String productFileName, String productName,                                      String productNumber, String checkProductName, String doStandard, String checkMatchine){        productInfoEnsureActivityModel.postProductInfoEnsure(userId,productFileNumber, productFileName, productName, productNumber, checkProductName, doStandard, checkMatchine, new Callback() {            @Override            public void onFailure(Call call, IOException e) {                productInfoEnsureActivityView.onPostProductInfoEnsureFailed();            }            @Override            public void onResponse(Call call, Response response) throws IOException {                productInfoEnsureActivityView.onPostProductInfoEnsureSucess();            }        });    }}